import React from "react";

const Login = () => {
  return (
    <>
      <div className="row">
        <div className="col-md-8">
          <img src="./asserts/images/banner1.jpg" alt="loginImg" />
        </div>
        <div className="col-md-4">login</div>
      </div>
    </>
  );
};

export default Login;
